import React, { Component } from 'react';
import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import Button from '@material-ui/core/Button';
import CardHeader from '@material-ui/core/CardHeader';
import TextField from '@material-ui/core/TextField';

class Login_Page extends Component {
    render() {
        return (
            <React.Fragment>
                <form noValidate autoComplete="off">
                    <Card>
                        <CardHeader title="Login App" />
                            <div>
                                <TextField id="username" type="email" label="Username" placeholder="Username" />
                                <br/>
                                <TextField id="password" type="password" label="Password" placeholder="Password" />
                            </div>
                        <CardActions>
                            <Button variant="contained" size="large" color="secondary">             Login </Button>
                        </CardActions>
                    </Card>
                </form>
            </React.Fragment>
        );
    }

}

export default Login_Page;
